<template>
  <div class="nav-page">
    <div class="content">
       <router-view></router-view>
    </div>
    <div >
      <van-tabbar class="footer" v-model="active" inactive-color="#414141" active-color="#f75d55">
        <van-tabbar-item @click="goState({name:'home'})">
          <span>推荐</span>
          <img
            slot="icon"
            slot-scope="props"
            :src="props.active ? tuij.active : tuij.inactive"
            class="nav-icon"
          >
        </van-tabbar-item>
        <van-tabbar-item @click="goState({name:'zhaomh'})">
          <span>找漫画</span>
          <img
            slot="icon"
            slot-scope="props"
            :src="props.active ? zhaomh.active : zhaomh.inactive"
            class="nav-icon"
          >
        </van-tabbar-item>
        <van-tabbar-item @click="goState({name:'mineBook'})">
          <span>我的漫画</span>
          <img
            slot="icon"
            slot-scope="props"
            :src="props.active ? mineBook.active : mineBook.inactive"
            class="nav-icon"
          >
        </van-tabbar-item>
        <van-tabbar-item @click="goState({name:'huati'})">
          <span>话题</span>
          <img
            slot="icon"
            slot-scope="props"
            :src="props.active ? huati.active : huati.inactive"
            class="nav-icon"
          >
        </van-tabbar-item>
        <van-tabbar-item @click="goState({name:'zhangHao'})">
          <span>账号</span>
          <img
            slot="icon"
            slot-scope="props"
            :src="props.active ? zhanghao.active : zhanghao.inactive"
            class="nav-icon"
          >
        </van-tabbar-item>
      </van-tabbar>

    </div>
  </div>
</template>

<script>
  export default {
    data() {
      return {
        active: 0,
        tuij: {
          active: 'data:image/png;base64,',
          inactive: 'data:image/png;base64,'
        },
        zhaomh: {
          active: 'data:image/png;base64,',
          inactive: 'data:image/png;base64,'
        },
        mineBook: {
          active: 'data:image/png;base64,',
          inactive: 'data:image/png;base64,'
        },
        huati: {
          active: 'data:image/png;base64,',
          inactive: 'data:image/png;base64,'
        },
        zhanghao: {
          active: 'data:image/png;base64,',
          inactive: 'data:image/png;base64,'
        }
      }
    },
    methods:{
      goState(o){
        this.$router.push(o);
      }
    },
    created(){

      let paths = this.$route.path;

      if(paths == '/home'){
        this.active = 0;
        return
      }

      if(paths == '/zhaomh'){
        this.active = 1;
        return
      }

      if(paths == '/mineBook'){
        this.active = 2;
        return
      }

      if(paths == '/huati'){
        this.active = 3;
        return
      }

      if(paths == '/zhangHao'){
        this.active = 4;
        return
      }

    }
  }
</script>

<style lang="less" secoped>
  .nav-page{
    width: 100%;
    height: 100%;
  }
  .content{
    height: calc(100% - 60px );
    overflow-y: auto;
  }
  .footer{
    width: calc(100% - 20px);
    padding: 0 10px;
    height: 50px;
    padding-bottom: 10px;
    .nav-icon{
      width: 25px;
      height: 25px;
    }
  }
</style>
